// OneDark
import React from 'react';
import axios from 'axios'; 
import { useState, useEffect, useRef } from "react";
import { useNavigate } from "react-router-dom";
import "./EditPage.css";
import AppBar from '@mui/material/AppBar';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import TextField from '@mui/material/TextField';
import SendIcon from '@mui/icons-material/Send';
import ContactBlock from '../ContactBlock/ContactBlock';

const EditPage = ({contact}) => {
  const inputNameRef = useRef(null);
  const inputPhoneNumberRef = useRef(null);
  const inputEmailRef = useRef(null);

//   const [contactsData, setContactsData] = useState([])

//   useEffect(() => {
//       axios.get('http://localhost:3002/contacts')
//      .then(({data}) => {
//       setContactsData(data)})
//  },[])
   
    let navigate = useNavigate();

    const handleEditContact = (e) => {
        e.preventDefault();
        // console.log(userID)

        // axios.put('http://localhost:3002/contacts/', 
        // { id: contactsData[contactsData.length-1].id+1,
        //   ownerId: parseInt(localStorage.getItem('userID')),
        //   name: inputNameRef.current.value,
        //   email: inputEmailRef.current.value, 
        //   phonenumber: inputPhoneNumberRef.current.value});
    }
    
    
    return (
      <>
    <form className="loginForm" onSubmit={handleEditContact}>
      <div className="home__container">
        <div>
          {/* <div className="name__input">
            <input type="text" ref={inputRef} />
          </div> */}
          <div className="name__input">
              <TextField
                id="outlined-name-input"
                style = {{width: 350}}
                defaultValue={contact.name}
                // value = {contact.name}
                label="Name"
                type="name"
                inputRef={inputNameRef}
              />
          </div>
          <div className="mail__input">
              <TextField
                id="outlined-mail-input"
                style = {{width: 350}}
                defaultValue="Normal"
                // value = {contact.email}
                label="Mail"
                type="mail"
                inputRef={inputEmailRef}
              />
          </div>
          <div className="phone__input">
              <TextField
                id="outlined-phone-input"
                style = {{width: 350}}
                defaultValue="Normal"
                // value = {contact.phonenumber}
                label="Phone number"
                type="phone"
                inputRef={inputPhoneNumberRef}
              />
          </div>
          <div className="login__button">
            <Button 
              type="submit"
              variant="contained"  
              style = {{width: 200}} 
              endIcon={<SendIcon />}
              // onClick={handleAddNewContact}
            >Save</Button>
          </div>
        </div>
      </div>
    </form>
      </>
    );
};

export default EditPage;
